generatorFunction:
function (seed) {
    var len = 1;
    var arr = [];
    var generator = (0, seedrandom.default)(seed);
    for (var i = 0; i < len; i++) {
        arr.push(generator());
    }
    return arr;
}

validationFunction:
function (output, seed) {
    var len = 1;
    var arr = [];
    var generator = (0, seedrandom.default)(seed);
    for (var i = 0; i < len; i++) {
        arr.push(generator());
    }
    output.map(function (val, idx) {
        if (val !== arr[idx]) {
            return false;
        }
    });
    return true;
}

